max_minutes = 45
take_profit=3
stop_loss=-3

portfolio = {}
profits = []


def convertVolume(coin, current_price):
    lot_size = {}
    volume = {}
    lot_size[coin]=0

    volume[coin] = float(100 / float(current_price))

    if coin not in lot_size:
        volume[coin] = float('{:.1f}'.format(volume[coin]))

    else:
        volume[coin] = float('{:.{}f}'.format(volume[coin], lot_size[coin]))

    return volume[coin]

def buy(coin, curr_data, qnt):
    holding = {}
    holding['bought_time'] = curr_data[0]
    holding['bought_price'] = curr_data[1]
    holding['qnt'] = qnt
    portfolio[coin] = holding

def sell(coin, curr_data):
    # update account value
    profits.append((float(curr_data[1])-float(portfolio[coin]['bought_price']))*float(portfolio[coin]['qnt']))
    # delete key from portfolio hashmap
    portfolio.pop(coin)


def get_tend(end, start):
    if end > start:
        return True
    else:
        return False


def sell_condition(coin,curr_data):
    if float(curr_data[0])/1000 - float(portfolio[coin]['bought_time'])/1000 > 60*max_minutes:
        return True
    else:

        current_price = float(curr_data[1])
        bought_price = float(portfolio[coin]['bought_price'])


        percentage = ((current_price-bought_price)/bought_price)*100
        if percentage>=take_profit or percentage<=-stop_loss:
            return True
        else:
            return False


